import React, { useEffect, useRef, useState } from 'react';

function DevelopingFutureStars() {
  const [isVisible, setIsVisible] = useState(false);
  const imageRef = useRef();

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        setIsVisible(entry.isIntersecting);
      },
      {
        threshold: 0.2, // The image becomes visible when 20% is in view
      }
    );

    if (imageRef.current) {
      observer.observe(imageRef.current);
    }

    return () => {
      if (imageRef.current) {
        observer.unobserve(imageRef.current);
      }
    };
  }, []);

  return (
    <section className="relative pb-16 bg-custom-cloud">
      {/* Cloud Shape SVG Positioned at the top */}
      <div className="absolute top-0 left-0 w-full">
        <svg
          viewBox="0 0 1440 160" // Adjusted height
          xmlns="http://www.w3.org/2000/svg"
          className="w-full h-full"
        >
          <path
            fill="#f8f6ee" // Cloud color, you can change it
            d="M0,128L48,112C96,96,192,64,288,64C384,64,480,96,576,117.3C672,139,768,149,864,144C960,139,1056,117,1152,96C1248,75,1344,53,1392,42.7L1440,32L1440,0L1392,0C1344,0,1248,0,1152,0C1056,0,960,0,864,0C768,0,672,0,576,0C480,0,384,0,288,0C192,0,96,0,48,0L0,0Z"
          />
        </svg>
      </div>

      {/* Content Section */}
      <div className="max-w-screen-xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-12">
        
        {/* Sticky Note 1 */}
        <div className="relative w-full flex justify-center">
          {/* Depth effect shadow */}
          <div className="absolute top-2 w-96 h-full mr-5 bg-black opacity-10 transform rotate-2 rounded-md ml-12"></div>
          <div className="relative w-96 h-auto p-8 bg-custom-beige rounded-md shadow-2xl transform rotate-3 hover:rotate-1 transition-all duration-500 ml-12 text-center">
            <h3 className="text-2xl font-bold">After School Care Service</h3>
            <p className="mt-4 text-gray-700 text-base">
              DStar is committed to providing the highest level of before-after school care to your child. We aim to be a one-stop educational center that fulfills the learning needs of your child.
            </p>
          </div>
        </div>

        {/* Text Container for Sticky Note 1 */}
        <div className="flex items-center bg-white shadow-lg p-6 rounded-md">
          <p className="text-lg text-gray-700">
            Our After School Care provides homework supervision and guidance by experienced tutors, helping students stay on track academically while ensuring a safe and engaging environment for after-school activities.
          </p>
        </div>

        {/* Text Container for Sticky Note 2 */}
        <div className="flex items-center bg-white shadow-lg p-6 rounded-md order-2 md:order-1">
          <p className="text-lg text-gray-700">
            Our tuition service is designed to cater to individual learning needs, offering personalized sessions for students. We provide a comprehensive range of subjects for students from Primary 1 onwards, led by qualified tutors.
          </p>
        </div>

        {/* Sticky Note 2 */}
        <div className="relative w-full flex justify-center order-1 md:order-2">
          {/* Depth effect shadow */}
          <div className="absolute top-2 ml-5 w-96 h-full bg-black opacity-10 transform -rotate-2 rounded-md"></div>
          <div className="relative w-96 h-auto p-8 bg-custom-beige rounded-md shadow-2xl transform -rotate-2 hover:-rotate-1 transition-all duration-500 text-center">
            <h3 className="text-2xl font-bold">Tuition Service</h3>
            <p className="mt-4 text-gray-700 text-base">
              DStar provides tuition from Primary 1 onwards. Speak with our consultant today. Our tuition teachers are highly qualified (some ex-school teachers).
            </p>
          </div>
        </div>

        {/* Sticky Note 3 */}
        <div className="relative w-full flex justify-center">
          {/* Depth effect shadow */}
          <div className="absolute top-2 mr-5 w-96 h-full bg-black opacity-10 transform rotate-4 rounded-md"></div>
          <div className="relative w-96 h-auto p-8 bg-custom-beige rounded-md shadow-2xl transform rotate-4 hover:rotate-2 transition-all duration-500 text-center">
            <h3 className="text-2xl font-bold">Enrichment Program</h3>
            <p className="mt-4 text-gray-700 text-base">
              DStar offers event-based classes like creative writing, robotics tryouts, and other exciting activities to enrich your child's learning experience.
            </p>
          </div>
        </div>

        {/* Text Container for Sticky Note 3 */}
        <div className="flex items-center bg-white shadow-lg p-6 rounded-md">
          <p className="text-lg text-gray-700">
            Our enrichment programs engage children in creative and hands-on activities. From robotics to arts and crafts, these programs are designed to enhance critical thinking and problem-solving skills in a fun and educational setting.
          </p>
        </div>

        {/* Text Container for Sticky Note 4 */}
        <div className="flex items-center bg-white shadow-lg p-6 rounded-md order-2 md:order-1">
          <p className="text-lg text-gray-700">
            Our holiday programs provide full-day care for children during school breaks. With a mix of educational and fun activities, these programs keep children engaged and learning in a nurturing environment.
          </p>
        </div>

        {/* Sticky Note 4 */}
        <div className="relative w-full flex justify-center order-1 md:order-2">
          {/* Depth effect shadow */}
          <div className="absolute top-2 mr-5 w-96 h-full bg-black opacity-10 transform -rotate-2 rounded-md"></div>
          <div className="relative w-96 h-auto p-8 bg-custom-beige rounded-md shadow-2xl transform -rotate-3 hover:-rotate-2 transition-all duration-500 mr-10 text-center">
            <h3 className="text-2xl font-bold">School Holiday Program</h3>
            <p className="mt-4 text-gray-700 text-base">
              DStar offers full-day care programs during school holidays to keep your child engaged and learning while having fun!
            </p>
          </div>
        </div>
      </div>
    </section>
  );
}

export default DevelopingFutureStars;
